import Input from '@mui/joy/Input';
import styled from '@emotion/styled';
import { Option, Select } from '@mui/joy';

const Container = styled.div`
  // display: flex;
  // justify-content: space-between;
`;

const Row = styled.div`
  margin-top: 16px;
  display: flex;
  justify-content: space-between;
`;

const StyledSelect = styled(Select)`
  width: 400px;
`;

const StyledInput = styled(Input)`
  width: 400px;
`;

const SharedExpenseRow = ({ namesObj, isDisabled }) => {
  const optionsArr = Object.entries(namesObj).map((name) => (
    <Option value={name[0]} disabled={isDisabled}>
      {name[1]}
    </Option>
  ));

  return (
    <Container>
      <Row>
        <StyledSelect
          placeholder="Select multiple people"
          multiple={true}
          disabled={isDisabled}
        >
          {optionsArr}
        </StyledSelect>
        <StyledInput
          className={`person-${i}-shared-amount`}
          placeholder="Amount"
          variant="outlined"
          type="number"
          disabled={isDisabled}
        />
      </Row>
    </Container>
  );
};

export default SharedExpenseRow;
